import React from 'react';

import '../css/Team.css';

const TeamMember = (props) => {
	return (
		<div>
			<img src={props.image} alt={props.name} className="member-photo" />
			<h4 className="member-name">{props.name}</h4>
			<p className="member-role">{props.role}</p>
			<p className="member-major">{props.major}</p>
		</div>
	);
};

export default TeamMember;
